import DROPDOWN from "./Dropdown.module.css";
const Dropdown = ({ senditems }) => {
  console.log(senditems);
  const renderedItems = senditems.map((items) => {
    <div>{items}</div>;
  });
  return <div className={DROPDOWN.container}></div>;
};
export default Dropdown;
